	private static String dbSQL_Cidades = 	"CREATE TABLE cidades(" +
													"ibge INTEGER PRIMARY KEY, " + 
													"nome VARCHAR(50), " +
													"uf VARCHAR(2)," +
													"favorita BOOLEAN" +
													");";

	private static String dbSQL_Lojas = 	"CREATE TABLE lojas(" +
													"loja_id INTEGER PRIMARY KEY, " + 
													"cidade_id INTEGER, " + 
													"nome VARCHAR(45), " +
													"local VARCHAR(45), " +
													"comparar BOOLEAN, " +
													"favorita BOOLEAN, " +
													"FOREIGN KEY(cidade_id) REFERENCES cidades(ibge) " +
													");";

	private static String dbSQL_Produtos = 	"CREATE TABLE produtos(" +
													"produto_id BIGINT PRIMARY KEY, " + 
													"descricao VARCHAR(45), " + 
													"favorito BOOLEAN" +
													");";
	
	private static String dbSQL_Precos = 	"CREATE TABLE precos(" +
													"produto_id BIGINT, " + 
													"loja_id INT, " + 
													"preco FLOAT , " + 
													"dt_confirmacao DATETIME, " + 
													"FOREIGN KEY(produto_id) REFERENCES produtos(produto_id), " +
													"FOREIGN KEY(loja_id) REFERENCES lojas(loja_id)" +
													"PRIMARY KEY(produto_id, loja_id) " +
													");";

